Rules.InvariantScript:
Set(
    gvCRUDType,
    fMagicNo.gvCRUDC
);
Set(
    gvCRUDCompany,
    Blank()
);

//*Before we can save, we have to validate required entries: FirstName, LastName and JobTitle
UpdateContext(
    {
        lvCompanyNameRequired: If(
            IsBlank(inpCompanyNameAddEdit.Value),
            "Company Name, ",
            Blank()
        )
    }
);
UpdateContext(
    {
        lvCompanyTypeRequired: If(
            IsBlank(cboCompanyCompanyTypeAddEdit.Selected.CompanyType),
            "Company Type, ",
            Blank()
        )
    }
);
UpdateContext(
    {
        lvAddressRequired: If(
            IsBlank(inpCompanyAddressAddEdit.Value),
            "Address, ",
            Blank()
        )
    }
);
UpdateContext(
    {
        lvCityRequired: If(
            IsBlank(inpCompanyCityAddEdit.Value),
            "City, ",
            Blank()
        )
    }
);
UpdateContext(
    {
        lvStateRequired: If(
            IsBlank(cboCompaniesStateAddEdit.Selected.StateAbbrev),
            "State, ",
            Blank()
        )
    }
);
UpdateContext(
    {
        lvZIPRequired: If(
            IsBlank(inpCompanyZIPAddEdit.Value),
            "ZIP, ",
            Blank()
        )
    }
);
UpdateContext(
    {
        lvTaxStatusRequired: If(
            IsBlank(cboCompanyTaxStatusAddEdit.Selected.TaxStatus),
            "Tax Status ",
            Blank()
        )
    }
);
If (
    Len(lvCompanyNameRequired & lvCompanyTypeRequired & lvAddressRequired & lvCityRequired & lvStateRequired & lvZIPRequired & lvTaxStatusRequired) > 0,
    Notify (
        "Company can't be saved without required fields: " & lvCompanyNameRequired & lvCompanyTypeRequired & lvAddressRequired & lvCityRequired & lvStateRequired & lvZIPRequired & lvTaxStatusRequired,
        NotificationType.Warning,
        fMagicNo.gvNotifyTimeout * 2
    );
    ,
    Set(
        gvCRUDCompanyID,
        Coalesce(
            gvCRUDCompany.CompanyID,
            0
        )
    );
    Set(
        gvCRUDType,
        If(
            gvCRUDCompanyID > 0,
            fMagicNo.gvCRUDU,
            fMagicNo.gvCRUDC
        )
    );
    Set(
        gvCompanyAddress,
        Text(inpCompanyAddressAddEdit.Value)
    );
    Set(
        gvBusinessPhone,
        Text(inpCompanyPhoneAddEdit.Value)
    );
    Set(
        gvCity,
        Text(inpCompanyCityAddEdit.Value)
    );
    Set(
        gvCompanyName,
        Text(inpCompanyNameAddEdit.Value)
    );
    Set(
        gvCompanyTypeID,
        Value(cboCompanyCompanyTypeAddEdit.Selected.CompanyTypeID)
    );
    Set(
        gvCompanyNotes,
        Text(inpCompanyHTMLNotesAddEdit.HtmlText)
    );
    Set(
        gvStandardTaxStatusID,
        Value(cboCompanyTaxStatusAddEdit.Selected.TaxStatusID)
    );
    Set(
        gvStateAbbrev,
        Text(cboCompaniesStateAddEdit.Selected.StateAbbrev)
    );
    Set(
        gvZip,
        Text(inpCompanyZIPAddEdit.Value)
    );
    Set(
        gvWebsite,
        Text(inpCompanyWebsiteAddEdit.Value)
    );
    Set(
        gvTGLCRUDCompany,
        !gvTGLCRUDCompany
    );

);

Set(
    gvCRUDCompanyID,
    Coalesce(
        gvCRUDCompany.CompanyID,
        0
    )
);
Set(
    gvCRUDType,
   fMagicNo.gvCRUDD
);
Set(
    gvTGLCRUDCompany,
    !gvTGLCRUDCompany
);

Select(Parent);
Set(
    gvCRUDOrder,
    ThisItem
);
Set(
    gvCRUDOrderID,
    gvCRUDOrder.OrderID
);
Navigate(scrOrderAdd);
